%[text] # Modeling Osmotic Pressure in Simscape
%[text] 
%[text] Osmotic pressure is a fundamental concept in chemistry and biology, describing the force required to prevent the flow of solvent molecules through a semipermeable membrane separating two solutions of different concentrations. This phenomenon is driven by the natural tendency of solvent molecules (often water) to move from a region of lower solute concentration to one of higher solute concentration to equalize concentrations on both sides of the membrane.
%[text] ![](text:image:212e)
%[text] Mathematically, osmotic pressure, $\\Pi${"editStyle":"visual"}, for dilute solutions can be described by the [van 't Hoff equation](internal:M_8842):
%[text] $\\Pi =i\\;M\\;R\\;T${"editStyle":"visual"}
%[text] where:
%[text] - $i${"editStyle":"visual"} is the van 't Hoff factor (number of particles the solute splits into),
%[text] - $M${"editStyle":"visual"} is the molar concentration of the solute,
%[text] - $R${"editStyle":"visual"} is the universal gas constant,
%[text] - $T${"editStyle":"visual"} is the absolute temperature (in Kelvin). \
%[text] 
%[text] Osmotic pressure plays a crucial role in biological systems, industrial processes, and laboratory techniques such as dialysis and reverse osmosis. Understanding this concept helps in predicting the movement of fluids across membranes, designing separation processes, and explaining cellular behavior in different environments.
%[text] ## Manometer with Semipermeable Membrane
%[text] First, we compute the column height difference statically by solving the force balance equations. The force from osmotic pressure is on the column of salty water is
%[text] $F\_o =\\frac{i\\;m\_0 \\;R\\;T}{M\_{\\mathrm{NaCl}\\;} A\\;\\left(\\frac{x}{2}+h\_0 \\right)}${"editStyle":"visual"},
%[text] where $M\_{\\mathrm{NaCl}}${"editStyle":"visual"} is the molar mass of the salt, $A${"editStyle":"visual"} is the column area, $h\_0${"editStyle":"visual"} is the initial column height and $x${"editStyle":"visual"} is the difference in heights of the pure and salty columns. Balancing this with the force gravity exerts, *i.e.*,
%[text] $F\_g =\\rho \\;g\\;x${"editStyle":"visual"},
%[text]  we can solve for the column height difference. Here, we assume the density of the salt is small compared to the density of water. The MATLAB code for this calculation is here:
% Parameters
A = 1/100^2;          % [m^2] Cross sectional area
h0 = 0.5;             % [m] Initial column height
ii = 2;               % [1] Charge for NaCl -- there are 2 ions
c = 0.05;             % [kg/m^3] Salt mass concentration in solution
m0 = c*A*h0;          % [kg] Salt mass in salty column
M_NaCl = 0.05844;     % [kg/mol] Molar mass of NaCl
M = c/M_NaCl;         % [mol/m^3] Molar concentration of NaCl    
R = 8.314;            % [J/(mol*K)]
T = 293.15;           % [K] Temperature

% Osmotic Pressure via van 't Hoff equation:
pi_os = ii*M*R*T;       % [Pa] 
% Fluid properties
rho = 998.2;         % [kg/m^3] Water density (approximate)
g = 9.81;            % [m/s^2] Gravitational acceleration

% Approximate column height difference (first term on rhs is osmotic pressure,
% second is gravity)
fnc = @(x)ii*m0/M_NaCl/A/(x/2+h0)*R*T - rho*g*x;
delta_h_calc = fzero(fnc, 0.0) %[output:86b9817d]
%%
%[text] ## Physical Models of the Membrane
%[text] Now that we have the steady-state solution, we can investigate the time-dependent behavior of the membrane. We'll perform this investigation by creating a custom component for a chamber that will exchange information with the membrane via physical signals. See `simple_chamber.ssc` for the implementation. Here we open a model with two of these chambers connected by a membrane model and run it. The difference in logged values for height at the end of the simulation is computed and agrees with the result above. 
% Test the system with physical signal based chamber.
open_system("simple_manometer");
out1 = sim("simple_manometer");
t1 = out1.simlog.Salt.h.series.time();
h_s1 = out1.simlog.Salt.h.series.values("m");
h_p1 = out1.simlog.Pure.h.series.values("m");
delta_h_sim1 = h_s1(end)-h_p1(end) %[output:5bd72775]
%[text] Now that we've checked our interface to the membrane, we'll switch to using the library blocks to accomplish the same results. To mimic the water column behavior, we can use a pair of translational mechanical converters. In this case, we use the measured height of the water columns to provide the external pressure for the converters. Running this simulation and looking at the logged data, we can see that the column height agrees with the static results. (We'll motivate the change to the more complex model the next section, where we'll turn this configuration into a basic desalinator.)
% Use translational mechanical converter model for the manometer tubes.
open_system("manometer");
out2 = sim("manometer");
t2 = out2.simlog.h_salty.x.series.time();
h_s2 = out2.simlog.h_salty.x.series.values("m");
h_p2 = out2.simlog.h_pure.x.series.values("m");
delta_h_sim2 = h_s2(end)-h_p2(end) %[output:4f719ea3]
%[text] What's more interesting about these simulations, is that it's possible to examine the dynamic behavior of the simulations. Here we show the column heights changing as a function of time for the first 120 seconds of simulation. We can see from the plot that the column height takes around 100 seconds to equilibrate.
figure; %[output:39f35b85]
clf; %[output:39f35b85]
plot(t2, h_s2, "LineWidth", 2) %[output:39f35b85]
hold on %[output:39f35b85]
grid on %[output:39f35b85]
plot(t2, h_p2, "LineWidth", 2) %[output:39f35b85]
xlim([0, 120]) %[output:39f35b85]
title("Column Heights for Osmotic Pressure Simulation"); %[output:39f35b85]
xlabel("t [s]"); %[output:39f35b85]
ylabel("h [m]") %[output:39f35b85]
legend("Salty Side", "Fresh Side", "Location", "east") %[output:39f35b85]
%%
%[text] ## Creating a Basic Desalinator
%[text] In this section we'll demonstrate the value of the dynamic model that uses the translational mechanical converters. In `simple_desalinator.slx`, we allow the model to equilibrate per the previous simulation, then apply a downward force to the salty chamber at 300 s. This displaces water across the membrane from the salty side to the pure side. First, we load the model and simulate it:
% Demonstrate a simple desalination process with the dynamic model.
open_system("simple_desalinator");
out3 = sim("simple_desalinator");
t3 = out3.simlog.h_salty.x.series.time();
h_s3 = out3.simlog.h_salty.x.series.values("m");
h_p3 = out3.simlog.h_pure.x.series.values("m");
% Plot the column heights
figure; %[output:083d4d87]
clf; %[output:083d4d87]
plot(t3, h_s3, "LineWidth", 2) %[output:083d4d87]
hold on %[output:083d4d87]
grid on %[output:083d4d87]
plot(t3, h_p3, "LineWidth", 2) %[output:083d4d87]
xlim([0, 360]) %[output:083d4d87]
title("Column Heights for Desalinator Simulation"); %[output:083d4d87]
xlabel("t [s]"); %[output:083d4d87]
ylabel("h [m]") %[output:083d4d87]
legend("Salty Side", "Fresh Side", "Location", "northwest") %[output:083d4d87]
%[text] As we can see from the plot the salty side column is pressed down at 300 s which causes the pure side height to rise. Now, let's take a closer look at the pressure in the salty chamber and the salt concentration in both chambers. 
% Plot the salt concentration and pressure of the salty side
p_s3 = out3.simlog.Salty_Water_Chamber.p_I.series.values("bar");
x_s3 = out3.simlog.Salty_Water_Chamber.x_I.series.values("kg/m^3");
x_p3 = out3.simlog.Pure_Water_Chamber.x_I.series.values("kg/m^3");
figure; %[output:72fedebd]
clf %[output:72fedebd]
yyaxis left %[output:72fedebd]
plot(t3,p_s3, "Linewidth", 2); %[output:72fedebd]
xlabel("t [s]"); %[output:72fedebd]
ylabel("p [bar]"); %[output:72fedebd]
yyaxis right %[output:72fedebd]
plot(t3,x_s3, t3, x_p3, "LineWidth",2); %[output:72fedebd]
ylabel("x [kg/m^3]"); %[output:72fedebd]
legend("Salty Pressure", "Salty Concentration", "Pure Concentration", "Location", "northwest") %[output:72fedebd]
%[text]  
%[text] Note that the salt concentration increases in the salty side while remaining constant in the pure side. This indicates we have desalinated some water from the salty side by pressing down on the column of water.
%%
%[text] %[text:anchor:M_8842] ## Appendix 1: Derivation of van 't Hoff's Equation 
%[text] We'll use the chemical potential balance method to derive the equation of van 't Hoff. Say we have a manometer which has a semi-permeable membrane at the bottom which allows the passage of water but blocks the passage of salt. For this example, let's work with sodium chloride, which divides into a sodium and chlorine ions when dissolved.  We can write the the chemical potential balance as
%[text] $\\mu\_A \\left(p+\\Pi \\;\\right)+R\\;T\\;\\ln \\left(a\_A \\right)=\\mu\_A \\left(p\\right)${"editStyle":"visual"},
%[text] where $\\mu\_A \\left(p\\right)${"editStyle":"visual"} is the chemical potential of a column of pure liquid at pressure $p${"editStyle":"visual"}. The second term on the left hand side is the product of the universal gas constant, $R${"editStyle":"visual"}, the temperature $T${"editStyle":"visual"} and the log of the activity coefficient, $a\_A${"editStyle":"visual"} for the solvent with solute. As above, $\\Pi${"editStyle":"visual"} is the osmotic pressure produced by the concentration gradient of salt across the membrane. Rearranging this equation we get
%[text] $\\mu\_A \\left(p+\\Pi \\right)-\\mu\_A \\left(p\\right)\\;=-R\\;T\\;\\ln \\left(a\_A \\right)${"editStyle":"visual"}.
%[text] Noting the relation for the derivative of chemical potential with respect to the pressure is the partial molar volume of solvent, i.e., 
%[text] $\\frac{\\;\\partial \\;\\mu \\;}{\\partial \\;p}=\\bar{\\;V\_A }${"editStyle":"visual"},
%[text] we can write
%[text] $\\Delta \\;\\mu \\approx \\bar{V\_A } \\;\\Delta p\\ldotp${"editStyle":"visual"}
%[text] Substituting the expression into the chemical potential equation above, we arrive at
%[text] $\\bar{V\_A } \\;\\Delta p=\\bar{V\_A } \\;\\Pi =-R\\;T\\;\\ln \\left(a\_A \\right)${"editStyle":"visual"}.
%[text] As we approach infinite dilution the activity $a\_A${"editStyle":"visual"} approaches 1 and the osmotic pressure goes to zero. If we solve for osmotic pressure in the dilute case, we can write
%[text] $\\Pi =-\\frac{R\\;T\\;}{\\bar{V\_A } }\\;\\ln \\left(a\_A \\right)\\approx -\\frac{R\\;T\\;}{\\bar{V\_A } }\\;\\ln \\left(y\_A \\right)\\approx -\\frac{R\\;T\\;}{\\bar{V\_A } }\\;\\ln \\left(1-y\_B \\right)\\approx \\frac{R\\;T\\;}{\\bar{V\_A } }\\;y\_B${"editStyle":"visual"},
%[text] where $y\_A${"editStyle":"visual"} and $y\_B${"editStyle":"visual"} are the mole fractions of solvent and solute, respectively. Recognizing that $M=\\frac{\\;y\_B }{\\bar{\\;V\_A } }${"editStyle":"visual"} is the molarity of solute and there are two ions (one sodium, and one chlorine) dissolved, we arrive at the van 't Hoff expression:
%[text] $\\Pi =i\\;M\\;R\\;T${"editStyle":"visual"}.
